select TOP 100 * 
from dbo.zz_import_PatientDemo_20100408

-- drop table [zz_import_PatientDemo_20100408_pat]

SELECT min(rowID) as rowID 
      ,[PatLName]
      ,[PatFName]
      ,[PatMidInit]
      ,cast([Patient DOB] as datetime) [Patient DOB]
      ,[Patient SS#]
      into [zz_import_PatientDemo_20100408_pat]
  FROM [superbill_3221_prod].[dbo].[zz_import_PatientDemo_20100408]
group by 
      [PatLName]
      ,[PatFName]
      ,[PatMidInit]
      ,cast([Patient DOB] as datetime)
      ,[Patient SS#]

update [zz_import_PatientDemo_20100408]
set patientID = null
      
update z
set patientID=p.rowID
FROM [zz_import_PatientDemo_20100408] z
	inner join [zz_import_PatientDemo_20100408_pat] p
		on 		
      z.[PatLName]=p.[PatLName]
      and z.[PatFName]=p.[PatFName]
      and z.[PatMidInit]=p.[PatMidInit]
      and z.[Patient DOB]=p.[Patient DOB]
      and z.[Patient SS#]=p.[Patient SS#]
      
      


declare @practiceID int, @vendorImportID int
select @practiceID=1, @vendorImportID=1

	INSERT INTO [dbo].[Patient](
		prefix,
		Suffix,
		MiddleName,
		[PracticeID],
		[FirstName],
		[LastName],
		[AddressLine1],
		[AddressLine2],
		[City],
		[State],
		[ZipCode],
		[HomePhone],
		WorkPhone,
		WorkPhoneExt,
		MobilePhone,
		[DOB],
		SSN,
		[Gender],
		[VendorID],
		MedicalRecordNumber,
		VendorImportID,
		CollectionCategoryID,
		DefaultServiceLocationID,
		PrimaryProviderID,
		EmailAddress,
		EmploymentStatus,
		EmployerID,
		MaritalStatus
		)
	    
	SELECT 
		'',
		'',
		i.PatMidInit as MI,
		@practiceID as practiceID,
		isnull( i.PatFName, ''),
		isnull( i.PatFName, ''),
		left(PatAddr1, 256),
		left(ltrim(PatAddr2 + ' ' + isnull('apt - ' + nullif(PatAptNumber, ''), '') ), 256),
		PatCity,
		PatState,
		replace(PatZip, '-', ''),
		cast( PatHPhone1+PatHPhone2+PatHPhone3 as bigint),
		cast( PatWPhone1+PatWPhone2+PatWPhone3 as bigint),
		null as wkExt,
		null as MobilePhone, 
		i.[Patient DOB] dob,
		replace(i.[Patient SS#], '-', '') SSN,
		null [Sex],  
		i.rowid as [VendorID], -- vendorID
		null as  MRN,
		@vendorImportID, -- vendorID
		1,
		null as serviceLocationID,
		null as primaryProviderID,
		null as Email,
		EmploymentStatus = null ,
		null EmployerID,
		null as MaritalStatus
	from dbo.zz_import_PatientDemo_20100408_pat i
		inner join zz_import_PatientDemo_20100408 z
			on z.rowId=i.rowID
	where not exists(select * from patient p where p.vendorID=i.rowID and p.vendorImportID=@vendorImportID)

-- rollback tran

update p
set workphone=null
from patient p
where vendorImportID=1
	and workPhone=cast(0 as bigint)


	-- Self Pay
	INSERT INTO [PatientCase]
		([PatientID]
		,[Name]
		,[Active]
		,[PayerScenarioID] -- select * from payerScenario
		,[CreatedUserID]
		,[ModifiedUserID]
		,[PracticeID]
		,VendorID
		,VendorImportID
		   )

	select
		patientID,	
		'DEFAULT CASE',
		1,
		11,
		951,
		951,
		practiceID,
		VendorID,
		VendorImportID
	from Patient p
	where VendorImportID in( 1 )
		and not exists(select * from patientCase pc where pc.patientID=p.patientID )



