-- Primry
select distinct InsuranceCompanyName,  ic.insuranceCompanyID,
	'exec InsurancePlanDataProvider_CreateInsurancePlan 
		@name=N''' + InsuranceCompanyName + '''
		,@street_1=N''' + addressline1 + '''
		,@program_code=N''CI''
		,@street_2=N''' + addressline2 + '''
		,@deductible=0
		,@company_id=' + cast(insuranceCompanyID as varchar(32)) + '
		,@fax_x=NULL
		,@phone='''+isnull(phone, '')+'''
		,@contact_suffix=NULL
		,@review_code=N''''
		,@phone_x=null
		,@contact_last_name=NULL
		,@city=N'''+ city +'''
		,@fax=NULL
		,@state=N'''+state+'''
		,@notes='''+ cast(vendorID as varchar(32)) +'''
		,@contact_prefix=NULL
		,@country=N''''
		,@contact_first_name=NULL
		,@copay=0
		,@zip=N'''+isnull(left(zipCode,9),'')+'''
		,@EClaimsAccepts=0
		,@practice_id=1
		,@contact_middle_name=NULL'
from insuranceCompany ic
where NOT exists(select * from insuranceCompanyPlan icp where icp.InsuranceCompanyID=ic.InsuranceCompanyID)



