update icp
set VendorImportID=1, vendorID=ic.vendorID
from insuranceCompanyPlan icp
	inner join insuranceCompany ic
		on ic.insuranceCompanyID=icp.insuranceCompanyID
	
update insuranceCompanyPlan
set ReviewCode='R'

update z
set insurancePlanID=icp.insuranceCompanyPlanID
from dbo.zz_import_PatientDemo_20100408 z
	inner join dbo.zz_import_PatientDemo_20100408_ins i
		on i.PrimInsCo=z.PrimInsCo
		and i.PrimInsCoAddr1=z.PrimInsCoAddr1
		and i.PrimInsCoCity=z.PrimInsCoCity
		and i.PrimInsCoState=z.PrimInsCoState
	inner join dbo.zz_import_PatientDemo_20100408_ins_master m
		on i.InsRowID=m.rowID
	inner join dbo.insuranceCompanyPlan icp
		on icp.vendorID=isnull(ParentRowID, m.rowID)




	-- delete [PatientCase] where vendorImportID=1
	-- Primary
	INSERT INTO [PatientCase]
		([PatientID]
		,[Name]
		,[Active]
		,[PayerScenarioID] -- select * from payerScenario
		,[CreatedUserID]
		,[ModifiedUserID]
		,[PracticeID]
		,VendorImportID
		,VendorID
		   )
	select
		p.patientID,	
		'default insurance policy',
		1,
		5,
		951,
		951,
		practiceID,
		VendorImportID,
		VendorID
	from Patient p
	where VendorImportID = 1
	

-- delete InsurancePolicy where vendorImportID=1
insert into dbo.InsurancePolicy(
	PatientCaseID
	,InsuranceCompanyPlanID
	,Precedence
	,PolicyNumber
	,GroupNumber

	,CardOnFile
	,PatientRelationshipToInsured
	,HolderThroughEmployer
	,PatientInsuranceStatusID
	,VendorID
	,VendorImportID
	,PracticeID
)
select 
	pc.PatientCaseID
	,w.InsurancePlanID
	,DENSE_RANK() over(partition by PatientCaseID order by w.InsurancePlanID) --Precedence
	,null as PolicyNumber
	,null as GroupNumber
	,0 as CardOnFile
	,'S' as PatientRelationshipToInsured
	,0 as HolderThroughEmployer
	,0 as PatientInsuranceStatusID
	,min(w.rowID) as VendorID
	,1 as VendorImportID
	,p.PracticeID
from zz_import_PatientDemo_20100408 w
	inner join Patient p (nolock)
		on p.patientID=w.patientID
	inner join PatientCase pc (nolock)
		on pc.patientID=p.patientID
		and pc.VendorID=p.VendorID
		and pc.[PayerScenarioID]=5
where p.vendorImportID=1
	and w.InsurancePlanID is not null
group by 
	pc.PatientCaseID
	,w.InsurancePlanID
	,p.PracticeID




update pc
set payerScenarioID=1
from patientCase pc
where patientCaseID NOT IN (select patientCaseID from InsurancePolicy )



update z
set patientID=p.patientID
from dbo.zz_import_PatientDemo_20100408 z
	inner join dbo.zz_import_PatientDemo_20100408_pat zp
		on zp.PatLName=z.PatLName
		and zp.PatFName=z.PatFName
		and zp.PatMidInit=z.PatMidInit
