insert into EncounterDiagnosis (EncounterID, DiagnosisCodeDictionaryID, ListSequence, PracticeID, vendorID, vendorImportID) 
select
	z.encounterID
	,d1.DiagnosisCodeDictionaryID
	,row_number() over(partition by encounterID order by d1.DiagnosisCodeDictionaryID) ListSequence
	, 1 as PracticeID
	,min(rowID) as [VendorID]
	,1 as [VendorImportID]
from zz_import_PatientDemo_20100408 z
	left join DiagnosisCodeDictionary d1
		on d1.diagnosisCode=z.icd9_1
