and isnumeric([unit price])=1
and isnumeric(quantity)=1
and not exists(select * from EncounterDiagnosis ed where ed.encounterID=z.encounterID and ed.DiagnosisCodeDictionaryID=d1.DiagnosisCodeDictionaryID)
group by encounterID, d1.DiagnosisCodeDictionaryID
order by encounterID


