INSERT INTO [dbo].[EncounterProcedure]
           ([EncounterID]
           ,[ProcedureCodeDictionaryID]
           ,[ServiceChargeAmount]
           ,[ServiceUnitCount]
           ,[ProcedureDateOfService]
           ,[PracticeID]
           ,[EncounterDiagnosisID1]
           ,[EncounterDiagnosisID2]
           ,[EncounterDiagnosisID3]
           ,[EncounterDiagnosisID4]
           ,[VendorID]
           ,[VendorImportID]
           ,[TypeOfServiceCode]
           ,[AnesthesiaTime]
           ,[ApplyPayment]
           ,[PatientResp])
select
	z.encounterID
	,z.[ProcedureCodeDictionaryID]
	,[unit price] as [ServiceChargeAmount]
	,quantity as [ServiceUnitCount]
	,dateOfService [ProcedureDateOfService]
	,1 as [PracticeID]
	,ed1.EncounterDiagnosisID as [EncounterDiagnosisID1]
	,ed2.EncounterDiagnosisID as [EncounterDiagnosisID2]
	,ed3.EncounterDiagnosisID as [EncounterDiagnosisID3]
	,ed4.EncounterDiagnosisID as [EncounterDiagnosisID4]
	,rowID as [VendorID]
	,1 as [VendorImportID]
	,1 as [TypeOfServiceCode]
	,0 as [AnesthesiaTime]
	,0 as [ApplyPayment]
	,0 as [PatientResp]
from zz_import_PatientDemo_20100408 z
	left join DiagnosisCodeDictionary d1
		on d1.diagnosisCode=z.icd9_1
	left join EncounterDiagnosis ed1
		on ed1.encounterID=z.encounterID
		and ed1.DiagnosisCodeDictionaryID=d1.DiagnosisCodeDictionaryID
	left join DiagnosisCodeDictionary d2
		on d2.diagnosisCode=z.icd9_2
	left join EncounterDiagnosis ed2
		on ed2.encounterID=z.encounterID
		and ed2.DiagnosisCodeDictionaryID=d2.DiagnosisCodeDictionaryID
	left join DiagnosisCodeDictionary d3
		on d3.diagnosisCode=z.icd9_3
	left join EncounterDiagnosis ed3
		on ed3.encounterID=z.encounterID
		and ed3.DiagnosisCodeDictionaryID=d3.DiagnosisCodeDictionaryID
	left join DiagnosisCodeDictionary d4
		on d4.diagnosisCode=z.icd9_4
	left join EncounterDiagnosis ed4
		on ed4.encounterID=z.encounterID
		and ed4.DiagnosisCodeDictionaryID=d4.DiagnosisCodeDictionaryID
where z.encounterID is not null
and [ProcedureCodeDictionaryID] is not null
and isnumeric([unit price])=1
and isnumeric(quantity)=1
and not exists(select * from [EncounterProcedure] w where w.vendorID=z.rowID and w.vendorImportID=1)
           
           
