--==== APPROVE Encounter =====           
declare @encounterID int
DECLARE vc CURSOR FOR 
SELECT encounterID
from encounter
where vendorImportID=1
	and encounterStatusID in (1,2)
order by dateOfService, encounterID

OPEN vc

FETCH NEXT FROM vc 
INTO @encounterID

WHILE @@FETCH_STATUS = 0
BEGIN

	EXECUTE [dbo].[EncounterDataProvider_ApproveEncounter] 
		   @encounterID
		  ,951 --phong
		  ,0

    FETCH NEXT FROM vc 
    INTO @encounterID
END 
CLOSE vc
DEALLOCATE vc




